def getrCID( li, fc='UNICODE'):
    #return getrCID_Dic( li, TAL(fc))
    if fc in ['UNICODE']: return getrCID_Dic( li, UNICODE)
    else: return 0

def getrCID_Dic( li, dic):
    for k,v in reversed(dic.items()):
        _k = k * 16 #0xF+1
        if  li < _k : continue
        return    v[2*(li-_k)]

